import { Link } from "react-router-dom";
const navbar = () => {
    return (
        <div>
            <li>
                <Link to="/">Dogs</Link>
            </li>
            <li>
                <Link to="/cats">Cats</Link>
            </li>
            <li>
                <Link to="/sheeps">Sheeps</Link>
            </li>
            <li>
                <Link to="/goats">Goats</Link>
            </li>
        </div>
    );
}
export default navbar;
